import React from 'react'

class Experience extends React.Component{
    constructor(props){
        super(props);
        this.state={
            companyName: '',
            positionTitle: '',
            dateFrom: '',
            dateUntil: ''

        }
        this.setName = this.setName.bind(this)
        this.setTitle = this.setTitle.bind(this)
        this.setDateFrom = this.setDateFrom.bind(this)
        this.setDateUntil = this.setDateUntil.bind(this)
        this.handleSubmit = this.handleSubmit.bind(this)
    }
    setName(event){
        this.setState({companyName:event.target.value})
    }
    setTitle(event){
        this.setState({positionTitle:event.target.value})
    }
    setDateFrom(event){
        this.setState({dateFrom:event.target.value})
    }
    setDateUntil(event){
        this.setState({dateUntil:event.target.value})
    }
    handleSubmit(event){
        event.preventDefault();
        console.log(this.state);
    }

    render(){
        return(
            <form className="section exp">
                <label>Company name</label>
                <input type='text' id='companyName' onChange={this.setName}/>
                <label>Position title</label>
                <input type='text' id='positionTitle' onChange={this.setName}/>
                <div className="dates">
                <label id="Date">Date</label>
                <label>From</label>
                <input type='text' id='dateFrom' onChange={this.setDateFrom}/>
                <label>Until</label>
                <input type='text' id='dateUntil' onChange={this.setDateUntil}/>
                </div>
                <button type="submit" onClick={this.handleSubmit}>Submit</button>
            </form>
        )
    }
}
export default Experience;
